import React, { Component } from "react";
import Lightbox from "react-awesome-lightbox";

export default class Zoom extends Component{
    render(){
        const img = this.props.match.params;
        return(
            <div>
            <p>{img}</p>
            <img src={img}></img>
            {/* <Lightbox image={"./"+img} className ="img-fluid" title="product"/> */}
            </div>
        )
    }
}
